import{_ as e,o as t,c as i,e as n}from"./app-91f40cf0.js";const a={},c=n('<div class="hint-container info"><p class="hint-container-title">相关信息</p><p>改派指学校就业方案上报吉林省高等学校毕业生就业指导中心之后，毕业生需要改换单位的。</p><p>依据吉政办发 [2003]15 号文件的有关规定，吉林省普通高校毕业生择业期(调整改派期限)为三年，三年之后改换单位属于在职人员流动，将不能进行改派。改派需要提交相关材料。毕业生收集齐改派材料后，到吉林省高等学校毕业生就业指导中心(省就业中心)换发新的报到证。</p></div><h2 id="改派流程" tabindex="-1"><a class="header-anchor" href="#改派流程" aria-hidden="true">#</a> 改派流程</h2><ul><li><p>毕业时未派遣的，持毕业证、学位证复印件、用人单位接收函(协议书或劳合同)直接到省就业中心二楼大厅办理。</p></li><li><p>毕业时派遣回生源所在地的，持毕业证、学位证复印件、原报到证原件、用人单位接收函(协议书或劳动合同)直接到省就业中心二楼大厅办理。</p></li><li><p>毕业时派遣至具体用人单位的，持毕业证复印件、原单位解约函原件、原报到证原件、新用人单位接收函到省就业中心二楼大厅办理。</p></li></ul><div class="hint-container tip"><p class="hint-container-title">提示</p><p>在 6 月 23 日报到证下发后，7 月 1 日毕业生离校前，改派可由就业中心代为办理。</p></div>',4),l=[c];function s(o,p){return t(),i("div",null,l)}const h=e(a,[["render",s],["__file","change.html.vue"]]);export{h as default};
